import React from "react";

function Loading() {
  return (
    <div className="loading">
      <h1>test</h1>
      <img src={require("./assets/load.gif")} className="img-fluid" alt="logo">
        Your stats are loading, please wait
      </img>
    </div>
  );
}

export default Loading;
